def color_burn_8(base: List[List[int]], active: List[List[int]]) -> List[List[int]]:
    return matrix_where(
        active,
        matrix_scalar_sub(
            255,
            matrix_elemwise_div(
                matrix_scalar_sub(255, base),
                matrix_where(active, active, lambda x, y: ite(x == 0, 1, y)),
            ),
        ),
        lambda x, y: ite(x == 0, 255, y),
    )
